INSERT INTO `filmy` (`ID_FILM`, `NAZWA`, `OPIS`, `DŁUGOŚĆ`, `OCENA`, `POSTER`) VALUES
(1, 'IronMan', '\"Iron Man\" to historia miliardera, przemysłowca i genialnego wynalazcy Tony’ego Starka (Robert Downey Jr.), szefa Stark Industries, głównego dostawcy broni dla rządu USA. Beztroski styl życia Tony’ego zmienia się na zawsze, kiedy po testach przeprowadzanych z nową bronią jego konwój zostaje zaatakowany, a on sam porwany przez rebeliantów. Ranny od pocisku, który utkwił w pobliżu serca, Tony zostaje zmuszony do skonstruowania potężnej broni dla Razy (Faran Tahir), tajemniczego przywódcy rebeliantów. Nie zważając jednak na żądania porywaczy, Tony wykorzystuje swój intelekt i geniusz, aby skonstruować zbroję, która utrzyma go przy życiu i pomoże w ucieczce. Po powrocie do Ameryki Tony stara się dojść do ładu ze swoją przeszłością i przysięga, że jego firma Stark Industries będzie się teraz rozwijać w zupełnie nowym kierunku. Mimo oporu Obadiaha Stane (Jeff Bridges), swojej prawej ręki i jednego z szefów firmy, który przejął nad nią rządy podczas jego nieobecności, Tony spędza całe dnie i noce w warsztacie, pracując nad konstrukcją zaawansowanej technologicznie zbroi, która zapewni mu nadludzką siłę i ochroni przed atakami. ', 126, 76, );
INSERT INTO `filmy` (`ID_FILM`, `NAZWA`, `OPIS`, `DŁUGOŚĆ`, `OCENA`, `POSTER`) VALUES
(2, 'Matrix', 'Neo (Keanu Reeves) jest genialnym hakerem. Pewnego dnia nawiązuje z nim kontakt tajemniczy Morfeusz (Laurence Fishburne) - człowiek, który obiecuje przekazać mu wiedzę o rzeczywistości, w jakiej żyje. Prawdę o dwóch światach: prawdziwym i wygenerowanym, który ma tylko udawać rzeczywistość. Neo przystaje do grupy Morfeusza i zaczyna dostrzegać, że świat, w którym egzystował to fikcja, a jego życiem cały czas ktoś kierował. Kolejne stopnie wtajemniczenia stawiają przed Neo nowe pytania. Czym jest Matrix i komu służy? I jaką rolę w planie Morfeusza ma do spełnienia on sam?', 136, 76, );
INSERT INTO `filmy` (`ID_FILM`, `NAZWA`, `OPIS`, `DŁUGOŚĆ`, `OCENA`, `POSTER`) VALUES
(3, 'Iniemamocni', 'Pan Parr, kiedyś znany powszechnie jako \"Iniemamocny\", oraz jego żona Helen, prowadzą życie emerytowanej pary superbohaterów. Zostali zmuszeni do zaniechania swej działalności piętnaście lat wcześniej i dziś spokojnie mieszkają na przedmieściu. Ich dzieci nie wiedzą wszystkiego o dawnych zajęciach rodziców. Niespodziewanie jednak przed Iniemamocnym pojawia się szansa, by wrócić do branży i przeprowadzić bardzo niebezpieczną, tajną akcję na dalekiej wyspie. Parr skorzysta z niej z ochotą, ale długa przerwa w aktywności sprawi, że nie będzie to łatwe. Przy okazji wciągnie w wir zdarzeń całą rodzinę.', 115, 69, );
INSERT INTO `filmy` (`ID_FILM`, `NAZWA`, `OPIS`, `DŁUGOŚĆ`, `OCENA`, `POSTER`) VALUES
(4, 'Lśnienie', 'Jack Torrance (Jack Nicholson) pracuje jako dozorca hotelu Panorama w górach stanu Kolorado. Pensjonat jest zamknięty na zimę, więc Jack z rodziną są jedynymi mieszkańcami budynku. Kiedy burze śnieżne blokują familię Torrance\'ów w hotelu, Danny (Danny Lloyd), syn Jacka, który ma nadprzyrodzone, telepatyczne zdolności odkrywa, że pensjonat jest nawiedzony i duchy powoli doprowadzają jego ojca do obłędu. Kiedy Jack spotyka zjawę pana Grady\'ego (Philip Stone), poprzedniego dozorcy hotelu, sytuacja staje się coraz groźniejsza.', 146, 78, );
INSERT INTO `filmy` (`ID_FILM`, `NAZWA`, `OPIS`, `DŁUGOŚĆ`, `OCENA`, `POSTER`) VALUES
(5, 'Avatar', 'Długo oczekiwany film Jamesa Camerona zrealizowany z wielkim rozmachem porównywalnym do \"Titanica\". Szacowany budżet na poziomie 237 milionów dolarów daje mu trzecie miejsce pod tym względem w historii kina. \"Avatar\" został wykonany w dwóch technikach: tradycyjnej 2D i zupełnie nowej technice 3D. Zdjęcia do filmu zostały wykonane w 2007 roku, natomiast na postprodukcję przeznaczono dwa lata. \"Avatar\" opowiada historię sparaliżowanego byłego komandosa, który dostaje szansę odzyskania zdrowego ciała. Musi jednak wziąć udział w specjalnym programie militarnym o nazwie Avatar. W rolach głównych między innymi Sam Worthington, Sigourney Weaver, Michelle Rodriguez.', 162, 74, );
INSERT INTO `filmy` (`ID_FILM`, `NAZWA`, `OPIS`, `DŁUGOŚĆ`, `OCENA`, `POSTER`) VALUES
(6, 'Kevin sam w domu', 'Rodzina McCallisterów zamierza spędzić Święta Bożego Narodzenia we Francji. W dzień wyjazdu omal nie spóźniają się na samolot. W wyniku małego zamieszania zapominają ze sobą zabrać Kevina (Macaulay Culkin). Ośmioletni chłopiec zostaje sam w domu, od tej pory musi sam sobie radzić ze wszystkim, w czym do tej pory wyręczali go rodzice... łącznie z dwoma złodziejami (Joe Pesci, Daniel Stern), którzy tylko czyhają, by okraść dom McCallisterów.', 103, 71, );
INSERT INTO `filmy` (`ID_FILM`, `NAZWA`, `OPIS`, `DŁUGOŚĆ`, `OCENA`, `POSTER`) VALUES
(7, 'Tylko mnie kochaj', 'Głównym bohaterem filmu jest Michał - współwłaściciel dużej firmy architektonicznej, który prowadzi nudne życie. Świeżości nie wprowadza nawet bliska znajomość z Agatą (drugą współwłaścicielką firmy). Kiedy wydaje się, iż nic nie może zmienić tego spokojnego życia, do drzwi mieszkania Michała puka siedmioletnia Michalina. Cały jego dotychczasowy porządek zostaje zachwiany...', 98, 59, );
INSERT INTO `filmy` (`ID_FILM`, `NAZWA`, `OPIS`, `DŁUGOŚĆ`, `OCENA`, `POSTER`) VALUES
(8, 'Tytanic', 'W słoneczny, kwietniowy dzień w 1912 roku, na angielskim wybrzeżu arystokratyczna rodzina wraz z 17-letnią Rose (Kate Winslet) wchodzi na pokład Titanica, udając się w podróż do Stanów Zjednoczonych. Pół godziny później grający w pokera w tanim, portowym barze 23-letni Jack Dawson (Leonardo DiCaprio) wygrywa szczęśliwym trafem bilet III klasy na rejs Titanikiem. W ostatniej chwili przed wypłynięciem statku wbiega na jego pokład. Tak zaczyna się wielka historia miłosna, która ma odmienić życie pięknej, bogatej, lecz nieszczęśliwej Rose oraz biednego, nie mającego nic prócz talentu malarskiego, Jacka.', 194, 73, );
INSERT INTO `filmy` (`ID_FILM`, `NAZWA`, `OPIS`, `DŁUGOŚĆ`, `OCENA`, `POSTER`) VALUES
(9, 'Irlandczyk', '\"Irlandczyk\" to osadzona w powojennej Ameryce epicka opowieść widziana oczami weterana II wojny światowej Franka Sheerana, oszusta i płatnego mordercy pracującego dla najbardziej osławionych przestępców XX wieku. Rozgrywająca się na przestrzeni kilkudziesięciu lat saga poświęcona jest jednej z największych zagadek kryminalnych w historii Stanów Zjednoczonych – tajemniczemu zaginięciu legendarnego przywódcy związków zawodowych Jimmy’ego Hoffa. Widzowie wezmą udział w brutalnej podróży, podczas której zostaną przed nimi odsłonięte kulisy funkcjonowania przestępczego półświatka, wewnętrznych walk o wpływy oraz kryminalnych powiązań ze światem polityki.', 210, 71, );

